import './App.css';
import Header from "./components/Header";
import Filters from "./components/Filters";
import TimeFrameSelector from "./components/TimeFrameSelector";

function App() {

    const Account_Type_Options = ["Academic", "Government", "Media", "Other", "Tourism"]
    const County_Options = ["Pasco", "Pinellas", "Hillsborough", "Manatee", "Sarasota"]
    const Word_Cloud_Options = ["Geo Tags", "Non-Geo Tags"]


    return (
    <div className="App">
      <header className="App-header">
        <Header />
      </header>
      <div className="Filters_Bar">
          <TimeFrameSelector />
          <Filters options={Account_Type_Options} Title={"ACCOUNT TYPE"}/>
          <Filters options={County_Options} Title={"COUNTY"}/>
          <Filters options={Word_Cloud_Options} Title={"WORD CLOUD"} />
      </div>
    </div>
  );
}

export default App;
